INSERT INTO `v1_4af6505a5f3fb22aa25722577b0b280918c4447c96d7be89e1ed39038dd585dd` VALUES (103711, 11, 28414, 10, "もちろんだよ。\n誕生日おめでとう、マツリちゃん。\nこの間の予防注射もきちんと受けてたし\n大人にまた一歩近づいたね♪", 1, 1, 0.5, 0, 0, 28414068);
