INSERT INTO `v1_4af6505a5f3fb22aa25722577b0b280918c4447c96d7be89e1ed39038dd585dd` VALUES (103611, 11, 35314, 10, "えっと、今日はありがとう……！\nでもこんな立派なお誕生日ケーキ、\n本当にもらってもいいの？\nお金とか、大丈夫だった……？", 1, 1, 0.5, 0, 0, 35314058);
