INSERT INTO `v1_4af6505a5f3fb22aa25722577b0b280918c4447c96d7be89e1ed39038dd585dd` VALUES (105611, 11, 38614, 10, "ああ、かまわないけど……\n急にあらたまって、どうしたんだい？\nずいぶん真剣な様子じゃないか。", 1, 1, 0.5, 0, 0, 38614074);
INSERT INTO `v1_4af6505a5f3fb22aa25722577b0b280918c4447c96d7be89e1ed39038dd585dd` VALUES (0, 91, 38614, "", "", "", "", "", "", "", 38614075);
