INSERT INTO `v1_4af6505a5f3fb22aa25722577b0b280918c4447c96d7be89e1ed39038dd585dd` VALUES (105111, 11, 38614, 10, "いえ、あのね？\nテーブルの下に、未使用のロウソクが\n大量に袋詰めしてあるんだけど。\nこれは、なに？", 1, 1, 0.5, 0, 0, 38614079);
INSERT INTO `v1_4af6505a5f3fb22aa25722577b0b280918c4447c96d7be89e1ed39038dd585dd` VALUES (0, 91, 38614, "", "", "", "", "", "", "", 38614080);
